import React, { useRef, useEffect, useState } from 'react';
import Webcam from 'react-webcam';
import * as faceapi from 'face-api.js';
import { useNavigate, useLocation } from 'react-router-dom';
import { Loader, AlertCircle, Smile } from 'lucide-react';

const MODEL_URL = '/models'; // You need to host models in public/models

const FaceAuth = () => {
  const webcamRef = useRef(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [step, setStep] = useState('detect'); // 'detect', 'success', 'fail'
  const navigate = useNavigate();
  const location = useLocation();

  // Determine if this is sign up or sign in
  const isSignUp = location.state && location.state.isSignUp;
  const user = JSON.parse(localStorage.getItem('chanakya_user'));

  useEffect(() => {
    const loadModels = async () => {
      setLoading(true);
      await faceapi.nets.tinyFaceDetector.loadFromUri(MODEL_URL);
      await faceapi.nets.faceRecognitionNet.loadFromUri(MODEL_URL);
      await faceapi.nets.faceLandmark68Net.loadFromUri(MODEL_URL);
      setLoading(false);
    };
    loadModels();
  }, []);

  const handleCapture = async () => {
    setError('');
    if (!webcamRef.current) return;
    const screenshot = webcamRef.current.getScreenshot();
    if (!screenshot) {
      setError('Could not capture image. Please try again.');
      return;
    }
    const img = await faceapi.fetchImage(screenshot);
    const detection = await faceapi.detectSingleFace(img, new faceapi.TinyFaceDetectorOptions()).withFaceLandmarks().withFaceDescriptor();
    if (!detection) {
      setError('No face detected. Please ensure your face is visible and try again.');
      return;
    }
    const descriptor = Array.from(detection.descriptor);
    if (isSignUp) {
      // Store descriptor in localStorage
      localStorage.setItem(`face_desc_${user.email}`, JSON.stringify(descriptor));
      setStep('success');
      setTimeout(() => navigate('/dashboard'), 1200);
    } else {
      // Compare with stored descriptor
      const stored = localStorage.getItem(`face_desc_${user.email}`);
      if (!stored) {
        setError('No face data found for this user. Please sign up again.');
        setStep('fail');
        return;
      }
      const storedDesc = new Float32Array(JSON.parse(stored));
      const distance = faceapi.euclideanDistance(detection.descriptor, storedDesc);
      if (distance < 0.5) {
        setStep('success');
        setTimeout(() => navigate('/dashboard'), 1200);
      } else {
        setError('Face does not match. Please try again.');
        setStep('fail');
      }
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-medical-50 to-primary-50">
      <div className="card max-w-md w-full space-y-6 text-center">
        <div className="flex flex-col items-center space-y-2">
          <Smile className="h-10 w-10 text-medical-600 mx-auto" />
          <h2 className="text-2xl font-bold text-gray-900">
            {isSignUp ? 'Face Registration' : 'Face Authentication'}
          </h2>
          <p className="text-gray-600">
            {isSignUp
              ? 'Please look at the camera to register your face.'
              : 'Please look at the camera to verify your identity.'}
          </p>
        </div>
        {loading ? (
          <div className="flex flex-col items-center space-y-2">
            <Loader className="animate-spin h-8 w-8 text-medical-600 mx-auto" />
            <span className="text-medical-600">Loading face recognition models...</span>
          </div>
        ) : (
          <>
            <Webcam
              audio={false}
              ref={webcamRef}
              screenshotFormat="image/jpeg"
              width={320}
              height={240}
              className="rounded-lg border border-medical-200 mx-auto"
              videoConstraints={{ facingMode: 'user' }}
            />
            <button
              className="btn-primary w-full mt-4"
              onClick={handleCapture}
              disabled={step === 'success'}
            >
              {isSignUp ? 'Register Face' : 'Verify Face'}
            </button>
            {error && (
              <div className="bg-red-50 border border-red-200 rounded-lg p-3 flex items-center space-x-2 mt-4">
                <AlertCircle className="h-5 w-5 text-red-500" />
                <span className="text-red-700 text-sm">{error}</span>
              </div>
            )}
            {step === 'success' && (
              <div className="bg-green-50 border border-green-200 rounded-lg p-3 flex items-center space-x-2 mt-4">
                <Smile className="h-5 w-5 text-green-500" />
                <span className="text-green-700 text-sm">Face {isSignUp ? 'registered' : 'verified'} successfully!</span>
              </div>
            )}
            {step === 'fail' && (
              <button
                className="btn-secondary w-full mt-2"
                onClick={() => { setStep('detect'); setError(''); }}
              >
                Try Again
              </button>
            )}
          </>
        )}
      </div>
    </div>
  );
};

export default FaceAuth;
